    "passFailSpiritSpeak": {
        "colComment": {},
        "rows": {
            "1": {
                "id": 1,
                "text": "总结下，为啥我们没打过？"
            },
            "2": {
                "id": 2,
                "text": "没事，反正又不是只有我们打不过。"
            },
            "3": {
                "id": 3,
                "text": "我们是不是该提升下能力再来打？"
            },
            "4": {
                "id": 4,
                "text": "胜败乃常事，不要气馁。"
            },
            "5": {
                "id": 5,
                "text": "注意休息，实在打不过就改天吧。"
            }
        }
    },
    "passWinSpiritSpeak": {
        "colComment": {},
        "rows": {
            "1": {
                "id": 1,
                "text": "OK，下一层，让我们继续。"
            },
            "2": {
                "id": 2,
                "text": "你是最猛的，没有之一。"
            },
            "3": {
                "id": 3,
                "text": "无压力，让我们继续下一层。"
            },
            "4": {
                "id": 4,
                "text": "这太简单了，我简直感受不到挑战的存在。"
            },
            "5": {
                "id": 5,
                "text": "老天，来点真正的挑战吧。"
            },
            "6": {
                "id": 6,
                "text": "据说通关后可以看到嫦娥洗澡，让我们继续。"
            },
            "7": {
                "id": 7,
                "text": "胜利总是来的这么突然，唉……"
            },
            "8": {
                "id": 8,
                "text": "求败，求败，但求一败啊……"
            },
            "9": {
                "id": 9,
                "text": "没难度，没挑战，无压力。"
            },
            "10": {
                "id": 10,
                "text": "注意保持姿势，不要停，继续。"
            }
        }
    },
    "spiritSpeak": {
        "colComment": {},
        "rows": {
            "1": {
                "id": 1,
                "text": "我是小精灵，我不是元神，也不是宠物……"
            },
            "2": {
                "id": 2,
                "text": "我到底是公的还是母的啊，费解。"
            },
            "3": {
                "id": 3,
                "text": "每一天，我都觉得，我自豪，我傲娇。"
            },
            "4": {
                "id": 4,
                "text": "嗨，吃饭了没。"
            },
            "5": {
                "id": 5,
                "text": "嗨，我真的猜不透你耶……"
            },
            "6": {
                "id": 6,
                "text": "人活得其实是一个心态，所以凡事随缘吧。"
            },
            "7": {
                "id": 7,
                "text": "作为仙界超级精灵，我对自己的长相极度自信。"
            },
            "8": {
                "id": 8,
                "text": "有时候想想，活着也真累，唉……"
            },
            "9": {
                "id": 9,
                "text": "据可靠消息，房价要暴跌了，最近记得别买房。"
            },
            "10": {
                "id": 10,
                "text": "仙界和人间也差不多，都一个屌样，没啥情趣。"
            },
            "11": {
                "id": 11,
                "text": "作为仙界超级精灵，我是有理想的小兽兽。"
            },
            "12": {
                "id": 12,
                "text": "尽量不要熬夜，嗨，很伤身体的。"
            },
            "13": {
                "id": 13,
                "text": "我喜欢吃山西臊子面，超赞的味道。"
            },
            "14": {
                "id": 14,
                "text": "嗨，今天心情好么，祝你游戏愉快唷。"
            },
            "15": {
                "id": 15,
                "text": "我今天很郁闷。"
            },
            "16": {
                "id": 16,
                "text": "每次看到你出现，我都觉得很幸福。"
            },
            "17": {
                "id": 17,
                "text": "每次45度仰望星空，我都不禁陷入沉思……"
            },
            "18": {
                "id": 18,
                "text": "上班时间记得多看电影，这样可以调节心情。"
            },
            "19": {
                "id": 19,
                "text": "不要太在意钱，钱就是个蛋。"
            },
            "20": {
                "id": 20,
                "text": "如果遇到相爱之人，要珍惜之。"
            },
            "21": {
                "id": 21,
                "text": "嗨，你是干啥的啊，当官的么？"
            },
            "22": {
                "id": 22,
                "text": "嫦娥其实长的很丑，我亲眼见过。"
            },
            "23": {
                "id": 23,
                "text": "爱情是个什么东东，你能告诉我么。"
            },
            "24": {
                "id": 24,
                "text": "昨天我看到苍空井老师了，好激动。"
            },
            "25": {
                "id": 25,
                "text": "超级讨厌玉帝，讨厌死了。"
            },
            "26": {
                "id": 26,
                "text": "寂寞不是苦，是心灵的一种福音。"
            },
            "27": {
                "id": 27,
                "text": "我今天好像感冒了，咳咳……"
            },
            "28": {
                "id": 28,
                "text": "人间好玩么，很想去看一看。"
            },
            "29": {
                "id": 29,
                "text": "上天其实是没有好生之德的。"
            },
            "30": {
                "id": 30,
                "text": "最近仙界妖气好重啊，得多加小心。"
            },
            "31": {
                "id": 31,
                "text": "我刚看到玉帝王母在野战，好猛。"
            },
            "32": {
                "id": 32,
                "text": "这些日子，我总是空虚寂寞冷……"
            },
            "33": {
                "id": 33,
                "text": "为什么神仙就没有恋爱自由呢？"
            },
            "34": {
                "id": 34,
                "text": "我喜欢听民族风，接地气，你觉得呢？"
            },
            "35": {
                "id": 35,
                "text": "最近总是感觉到一股浓重的杀气，凡事要小心。"
            },
            "36": {
                "id": 36,
                "text": "工作只是生活的一部分，但不是全部。"
            },
            "37": {
                "id": 37,
                "text": "你玩这游戏花钱了没，可别被坑了。"
            },
            "38": {
                "id": 38,
                "text": "生命的真谛在于心灵的自由，好难哦。"
            },
            "39": {
                "id": 39,
                "text": "从来都没有真正的民主，仙界也是。"
            },
            "40": {
                "id": 40,
                "text": "昨晚天庭停电了。"
            },
            "41": {
                "id": 41,
                "text": "王母的蟠桃有敌敌畏，最好别吃。"
            },
            "42": {
                "id": 42,
                "text": "不知道为什么，今天我很想喝酒。"
            },
            "43": {
                "id": 43,
                "text": "上天从来都不是公平的，怎么可能公平呢？"
            }
        }
    },
